  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:49.340014\",\n\t\"name\": \"memorandum-of-understanding-between-the-alaska-department-of-fish-and-game-alaska-departme\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Chickaloon Flats, as per the attached
  legal description and map involving forty-eight thousand acres, more or less, are
  recognized by the agreement participants as valuable waterfowl habitat and as a
  prime recreational hunting area. Therefore, wise management of the flats is needed
  to perpetuate this segment of natural habitat for thousands of waterfowl which annually
  utilize the marsh for nesting, feeding and resting. These uses will require formation
  of effective management guidelines which are best formulated through the coordinated
  and combined efforts of the participating agencies.\",\n\t\"license_title\": \"License
